// src/components/ProfileTabs/ProfileTab.js
import React from 'react';

const ProfileTab = ({ profileData }) => {
  if (!profileData) {
    return <p>Loading...</p>;
  }

  const { progress, actions } = profileData;

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-4">Profile Progress</h2>
      <p className="mb-4">Complete your profile and perform actions to level up!</p>
      <div className="w-full bg-gray-700 rounded-full h-6 mb-4">
        <div
          className="bg-primary h-6 rounded-full text-center text-sm font-medium leading-6"
          style={{ width: `${progress}%` }}
        >
          {progress}% Complete
        </div>
      </div>
      <ul className="list-disc pl-5 space-y-2">
        <li className={actions.customersAdded > 0 ? 'text-green-400' : 'text-gray-400'}>
          Add a customer {actions.customersAdded > 0 && '✓'}
        </li>
        <li className={actions.jobsAdded > 0 ? 'text-green-400' : 'text-gray-400'}>
          Add a job {actions.jobsAdded > 0 && '✓'}
        </li>
        <li className={actions.jobsCompleted > 0 ? 'text-green-400' : 'text-gray-400'}>
          Complete a job {actions.jobsCompleted > 0 && '✓'}
        </li>
      </ul>
    </div>
  );
};

export default ProfileTab;
